import React from "react";

export const ControlTables = () => {
  const nameOfTitles = ["#", "دسته", "عنوان", "وضعیت", "عملیات"];
  const nameOfFields = ["1", "2", "3", "4", "5"];
  const countOfRows = "10";
  return (
    <div className="p-2">
      <table className=" productTable table table-bordered border-primary ">
        <thead>
          <tr className="bg-info">
            {nameOfTitles.map((d) => (
              <th>{d}</th>
            ))}
          </tr>
        </thead>
        <tbody>
          <tr className="productTableRow">
            {nameOfFields.map((d) => (
              <td>{d}</td>
            ))}
          </tr>
        </tbody>
      </table>
    </div>
  );
};
